- input: "TEXT\x1CC00481341\x1C.TEXT\x1C\x1CF3A\x1CDr. Robinson was the winning candidate
    in the May 18, 2010 Republican Party primary election and is now a candidate in
    the July 30, 2010 Independent Party of Oregon primary election.  The Republican
    Party primary and the Independent Party of Oregon primary are separate elections
    with separate contribution limits.  The July 15th Quarterly Report includes contributions
    and expenditures made in connection with both primaries. FEC Form 3 does not contemplate
    a situation in which the same individual is a candidate in two separate primary
    elections in the same reporting period.  Accordingly, Art Robinson for Congress
    has designated contributions and expenditures made in connection with the May
    18, 2010 Republican Party primary as being for the Primary election and has designated
    contributions and expenditures made in connection with the July 30, 2010 Independent
    Party of Oregon primary as being for the Other election.\n"
